import React from 'react'

const IsGoingOut = () => {
    const [isGoingOut, setIsGoingOut] = React.useState(true)
    function flipState(){
        setIsGoingOut(isGoingOut ? "Yes" : "No")
        setIsGoingOut(isGoingOut ? "No" : "Yes")
    }

  return (
    <div>
        <button className='btn' onClick={flipState}>Toggle State</button>

        <button>{isGoingOut}</button>
    </div>
  )
}

export default IsGoingOut
